import React from "react";
import { FaInstagram, FaFacebook } from "react-icons/fa";
import "../Layout.css";

function Contact() {
  return (
    <div className="contact-container">
      <h1>Kontakta oss</h1>
      <div className="card">
        <p>
          <strong>E-post:</strong>{" "}
          <a href="mailto:exempel@kumlasportfiske.se">
            exempel@kumlasportfiske.se
          </a>
        </p>
        <p>
          <strong>Telefon:</strong> 0123-456789
        </p>
        <p>
          <strong>Adress:</strong> Sportfiskegatan 1, 692 30 Kumla
        </p>
        <p>
          <strong>Öppettider:</strong> Måndag–Fredag: 10:00–18:00
        </p>
        <p>
          <strong>Sociala medier:</strong>{" "}
          <a href="https://www.instagram.com/kumlasportfiske/" target="_blank" rel="noopener noreferrer" className="social-icon">
            <FaInstagram size={24} />
          </a>{" "}
          <a href="https://www.facebook.com/kumlasportfiske/" target="_blank" rel="noopener noreferrer" className="social-icon">
            <FaFacebook size={24} />
          </a>
        </p>
      </div>
    </div>
  );
}

export default Contact;
